import 'bootstrap/dist/css/bootstrap.min.css';

import React, { useState }  from 'react';
import {Navbar, Nav, Button} from 'react-bootstrap';
import './index.css'; 


const questions = [
    {
        question: 'How would a system administrator add an additional layer of login security to a users AWS Management Console?',
        options : ['Use Amazon Cloud Directory','Audit AWS Identity and Access Management (IAM) roles', 'Enable multi-factor authentication', 'Enable AWS CloudTrail'],
        correctAnswer : 'Emr'
},
        {
            question : 'Which service can identify the user that made the API call when an Amazon EC2 instance is terminated?',
            options :['AWS Trusted Advisor', 'AWS CloudTrail', 'AWS X-Ray', ' AWS Identity and Access Management (AWS IAM)'],
            correctAnswer : 'ECS'
        }
]

const Nav_bar = () => {
    return(
        <Navbar expand='lg'>
            <Navbar.Brand>Ezeiyoke Cosmas</Navbar.Brand>
            <Navbar.Toggle/>
            <Navbar.Collapse>

                <Nav className='me-auto nav_nav'>
                    <Nav.Link className='nav_text' href='#'>Home</Nav.Link>
                    <Nav.Link className='nav_text' href='#'>Instuctions</Nav.Link>

                </Nav>
            </Navbar.Collapse>
            </Navbar>
        
    );
}


const Bodycontent = () => {

    // const [isdisplay,displayNow] = useState(false)

    // const HandleDisplay = () => {
    //     displayNow(true)
    // }

  const [currentQuestion, setCurrentQuestion] = useState(0); 
  const [selectedAnswer, setSelectedAnswer] = useState(''); 
  const [isFlipped, setIsFlipped] = useState(false);

  const handleOptionChange = (e) => {
  setSelectedAnswer(e.target.value);
  setIsFlipped(false); 
  };
  
  const handleSubmit = () => {
    if (selectedAnswer) {
      setIsFlipped(true);
    } 
  };

  const handleNext = () => {
    if (currentQuestion < questions.length - 1) {
      setCurrentQuestion(currentQuestion + 1); 
    //   setSelectedAnswer(''); 
    //   setIsFlipped(false);
    } else {
      alert("You've completed the quiz!");
    }
  };


    return(
        <div>
        <div className='container question-cont'>
            <div className='row mb-4 question-row'>
                <div className='col-lg-6 timer'>
                    <div className='total-time'><h6>Total Time</h6></div>
                    <div className='progress progress-rule' role='progressbar'></div>
                </div>
            
               
            <div className='row mb-2'>
              <div className='col-lg-6 question'>
              <h5 className="score">{currentQuestion + 1}/65</h5>
              <h6>{questions[currentQuestion].question}</h6>
                <div className='option'>
                <ul className="option-list">
                {questions[currentQuestion].options.map((option, index) => (
                  <li className="options1" key={index}>
                    <label>
                      <input 
                        type="radio" 
                        name="option" 
                        value={option}
                        onChange={handleOptionChange}
                        checked={selectedAnswer === option}
                      /> {option}
                    </label>
                  </li>
                ))}
              </ul>
                </div>
                <div className='col-lg-12 move-button'>
                <button className='btn-block submit-block' onClick={handleSubmit}>submit</button>
              
                </div> 
            </div>
            </div>
                
            </div>

        </div>

        <div className='container answer-cont'>
            <div className='row mb-4 answer-row'>
               
            <div className='row mb-2'>
              <div className='col-lg-6 answer'>
              <h6>{questions[currentQuestion].question}</h6>
                <div className='answer-list'>
                <ul className=" ">
                    <li>Use Amazon Cloud Directory:Amazon Cloud Directory is a service for organizing hierarchies of data, like directories for employees or organizational units. It allows you to build flexible cloud-native directories for various types of information
                        <br />
                    Why it’s incorrect: It’s not related to securing the AWS Management Console login process. Cloud Directory focuses on directory-based data management, not enhancing user login security.</li>
              </ul>
                </div>
                <div className='col-lg-12 move-button'>
                <button className='btn-block submit-block' onClick={handleSubmit}>submit</button>
              
                </div> 
            </div>
            </div>
                
            </div>

        </div>
    

         
                      
                <div className='col-lg-12 move-button'>
                <button className='btn-block prev-block' >PREV</button>
                <button className='btn-block next-block' onClick={handleNext}>NEXT</button>
                </div> 
            </div>

    );
}


function App() {
    return(

        <div className='app'>

            <Nav_bar />
            <Bodycontent/>

        </div>

    )


}

export default App
